INSERT INTO `list_strategies` (`id`, `name`, `posted_by`, `details`, `created_at`, `updated_at`) VALUES
(1, 'Momentum Trading', 'Admin', 'def momentum_strategy(price_data):\r\n    # calculate returns and rolling average\r\n    returns = price_data.pct_change()\r\n    rolling_avg = returns.rolling(window=10).mean()\r\n    \r\n    # buy when the current return is positive and above the rolling average\r\n    # sell when the current return is negative and below the rolling average\r\n    position = pd.Series(0, index=returns.index)\r\n    position[returns > rolling_avg] = 1\r\n    position[returns < rolling_avg] = -1\r\n    \r\n    # calculate the trades and returns\r\n    trades = position.diff().fillna(0)\r\n    returns = (trades * returns).fillna(0)\r\n    \r\n    return returns.cumsum()', '2023-02-17 12:02:08', '2023-02-17 12:02:08'),
(2, 'Mean reversion', 'Admin', 'def mean_reversion_strategy(price_data):\r\n    # calculate the rolling mean and standard deviation\r\n    rolling_mean = price_data.rolling(window=20).mean()\r\n    rolling_std = price_data.rolling(window=20).std()\r\n    \r\n    # buy when the price is below the rolling mean minus the rolling standard deviation\r\n    # sell when the price is above the rolling mean plus the rolling standard deviation\r\n    position = pd.Series(0, index=price_data.index)\r\n    position[price_data < rolling_mean - rolling_std] = 1\r\n    position[price_data > rolling_mean + rolling_std] = -1\r\n    \r\n    # calculate the trades and returns\r\n    trades = position.diff().fillna(0)\r\n    returns = (trades * price_data.pct_change()).fillna(0)\r\n    \r\n    return returns.cumsum()', '2023-02-17 12:02:39', '2023-02-17 12:02:39'),
(3, 'Statistical arbitrage', 'Admin', 'def mean_reversion_strategy(price_data):\r\n    # calculate the rolling mean and standard deviation\r\n    rolling_mean = price_data.rolling(window=20).mean()\r\n    rolling_std = price_data.rolling(window=20).std()\r\n    \r\n    # buy when the price is below the rolling mean minus the rolling standard deviation\r\n    # sell when the price is above the rolling mean plus the rolling standard deviation\r\n    position = pd.Series(0, index=price_data.index)\r\n    position[price_data < rolling_mean - rolling_std] = 1\r\n    position[price_data > rolling_mean + rolling_std] = -1\r\n    \r\n    # calculate the trades and returns\r\n    trades = position.diff().fillna(0)\r\n    returns = (trades * price_data.pct_change()).fillna(0)\r\n    \r\n    return returns.cumsum()', '2023-02-17 12:04:23', '2023-02-17 12:04:23'),
(4, 'Altman Z-Score', 'Admin', 'This strategy uses a moving average to compute the ratio of the current price and volatility to their historical averages, and then calculates the z-score of these ratios. It then applies a weighted average to these z-scores to generate a final signal. Finally, it applies a threshold to the signal to determine when to buy or sell, and computes trades and returns based on the resulting position.\r\n.\r\n.\r\n.\r\n.\r\n.\r\n \r\n\r\nimport numpy as np\r\nimport pandas as pd\r\n\r\ndef high_frequency_trading_strategy(price_data, volatility_data):\r\n    # calculate the moving average of the price and volatility data\r\n    ma_price = price_data.rolling(window=10).mean()\r\n    ma_volatility = volatility_data.rolling(window=10).mean()\r\n\r\n    # compute the ratio of the current price to the moving average\r\n    price_ratio = price_data / ma_price\r\n\r\n    # compute the ratio of the current volatility to the moving average\r\n    volatility_ratio = volatility_data / ma_volatility\r\n\r\n    # compute the z-score of the price and volatility ratios\r\n    z_price = (price_ratio - price_ratio.mean()) / price_ratio.std()\r\n    z_volatility = (volatility_ratio - volatility_ratio.mean()) / volatility_ratio.std()\r\n\r\n    # compute the final signal as a weighted average of the z-scores\r\n    signal = 0.5 * z_price + 0.5 * z_volatility\r\n\r\n    # apply a threshold to the signal to determine when to buy or sell\r\n    position = np.zeros_like(signal)\r\n    position[signal > 1] = 1\r\n    position[signal < -1] = -1\r\n\r\n    # compute the trades and returns\r\n    trades = position - np.roll(position, 1)\r\n    trades[0] = 0\r\n    returns = trades * price_data\r\n\r\n    return returns.cumsum()', '2023-02-17 12:05:35', '2023-02-17 12:12:20'),
(5, 'Bollinger band', 'Admin', 'This strategy uses Bollinger Bands, which are based on a moving average and a standard deviation. It computes the upper and lower bands based on the moving average and standard deviation of the price data, and then determines the current position based on the price relative to the upper and lower bands. Finally, it computes trades and returns based on the resulting position.\r\n\r\nimport numpy as np\r\nimport pandas as pd\r\n\r\ndef high_frequency_trading_strategy(price_data):\r\n    # compute the moving average of the price data\r\n    ma_price = price_data.rolling(window=20).mean()\r\n\r\n    # compute the standard deviation of the price data\r\n    std_price = price_data.rolling(window=20).std()\r\n\r\n    # compute the upper and lower bands based on the moving average and standard deviation\r\n    upper_band = ma_price + 2 * std_price\r\n    lower_band = ma_price - 2 * std_price\r\n\r\n    # compute the current position based on the price relative to the upper and lower bands\r\n    position = np.zeros_like(price_data)\r\n    position[price_data > upper_band] = -1\r\n    position[price_data < lower_band] = 1\r\n\r\n    # compute the trades and returns\r\n    trades = position - np.roll(position, 1)\r\n    trades[0] = 0\r\n    returns = trades * price_data\r\n\r\n    return returns.cumsum()', '2023-02-17 12:06:51', '2023-02-17 12:06:51'),
(6, '50-200 Day MA', 'Admin', 'This strategy uses a simple moving average crossover approach. It computes the 50-day and 200-day moving averages of the price data, and then determines when the 50-day moving average crosses above or below the 200-day moving average. Based on these signals, it computes the position and then computes the trades and returns.\r\n\r\nimport numpy as np\r\nimport pandas as pd\r\n\r\ndef high_frequency_trading_strategy(price_data):\r\n    # compute the 50-day and 200-day moving averages of the price data\r\n    ma_50 = price_data.rolling(window=50).mean()\r\n    ma_200 = price_data.rolling(window=200).mean()\r\n\r\n    # determine when the 50-day moving average crosses above the 200-day moving average\r\n    cross_above = (ma_50 > ma_200) & (ma_50.shift(1) < ma_200.shift(1))\r\n\r\n    # determine when the 50-day moving average crosses below the 200-day moving average\r\n    cross_below = (ma_50 < ma_200) & (ma_50.shift(1) > ma_200.shift(1))\r\n\r\n    # compute the position based on the crossover signals\r\n    position = np.zeros_like(price_data)\r\n    position[cross_above] = 1\r\n    position[cross_below] = -1\r\n\r\n    # compute the trades and returns\r\n    trades = position - np.roll(position, 1)\r\n    trades[0] = 0\r\n    returns = trades * price_data\r\n\r\n    return returns.cumsum()', '2023-02-17 12:08:34', '2023-02-17 12:08:34'),
(7, 'MACD + RSI + RCI', 'Admin', 'This strategy computes several technical indicators (MACD, RSI, and CCI) and uses them to generate signals to buy or sell the asset. The `prepare_data()` method reads historical price data for the specified symbol and time frame, and resamples it to the specified frequency. The `compute_indicators()` method computes the technical indicators using the `talib` library. The `compute_position()` method generates a trading position based on the signals generated by the technical indicators. The `compute_trades_returns()` method computes the trades and returns based on the trading position and the historical prices. Finally, the `plot_trades_returns()` method plots the historical prices and the cumulative returns generated by the trading strategy.\r\n\r\nimport numpy as np\r\nimport pandas as pd\r\nimport talib\r\n\r\nclass HighFrequencyTradingStrategy:\r\n    def __init__(self, symbol, time_frame):\r\n        self.symbol = symbol\r\n        self.time_frame = time_frame\r\n        self.data = None\r\n        self.position = None\r\n        self.trades = None\r\n        self.returns = None\r\n\r\n    def prepare_data(self, start_date, end_date):\r\n        self.data = pd.read_csv(f\'{self.symbol}.csv\', index_col=\'Date\', parse_dates=True)\r\n        self.data = self.data.loc[start_date:end_date]\r\n        self.data = self.data.resample(self.time_frame).last().ffill()\r\n\r\n    def compute_indicators(self):\r\n        # compute the moving average convergence divergence (MACD) indicator\r\n        macd, signal, histogram = talib.MACD(self.data[\'Close\'])\r\n\r\n        # compute the relative strength index (RSI) indicator\r\n        rsi = talib.RSI(self.data[\'Close\'])\r\n\r\n        # compute the commodity channel index (CCI) indicator\r\n        cci = talib.CCI(self.data[\'High\'], self.data[\'Low\'], self.data[\'Close\'])\r\n\r\n        # combine the indicators into a single data frame\r\n        indicators = pd.DataFrame({\'MACD\': macd, \'Signal\': signal, \'Histogram\': histogram, \'RSI\': rsi, \'CCI\': cci})\r\n        self.data = pd.concat([self.data, indicators], axis=1)\r\n\r\n    def compute_position(self):\r\n        # determine when the MACD crosses above the signal line\r\n        cross_above = (self.data[\'MACD\'] > self.data[\'Signal\']) & (self.data[\'MACD\'].shift(1) < self.data[\'Signal\'].shift(1))\r\n\r\n        # determine when the MACD crosses below the signal line\r\n        cross_below = (self.data[\'MACD\'] < self.data[\'Signal\']) & (self.data[\'MACD\'].shift(1) > self.data[\'Signal\'].shift(1))\r\n\r\n        # determine when the RSI crosses above 70\r\n        rsi_above = (self.data[\'RSI\'] > 70) & (self.data[\'RSI\'].shift(1) < 70)\r\n\r\n        # determine when the RSI crosses below 30\r\n        rsi_below = (self.data[\'RSI\'] < 30) & (self.data[\'RSI\'].shift(1) > 30)\r\n\r\n        # determine when the CCI crosses above 100\r\n        cci_above = (self.data[\'CCI\'] > 100) & (self.data[\'CCI\'].shift(1) < 100)\r\n\r\n        # determine when the CCI crosses below -100\r\n        cci_below = (self.data[\'CCI\'] < -100) & (self.data[\'CCI\'].shift(1) > -100)\r\n\r\n        # compute the position based on the crossover and overbought/oversold signals\r\n        self.position = np.zeros_like(self.data[\'Close\'])\r\n        self.position[cross_above] = 1\r\n        self.position[cross_below] = -1\r\n        self.position[rsi_above] = -1\r\n        self.position[rsi_below] = 1\r\n        self.position[cci_above] = -1\r\n        self.position[cci_below] = 1\r\n\r\n    def compute_trades_returns(self):\r\n        # compute the trades and returns\r\n        self.trades = self.position - np.roll(self.position, 1)\r\n        self.trades[0] = 0\r\n        self.returns = self.trades * self.data[\'Close\']\r\n\r\n    def run_strategy(self, start_date, end_date\r\n    # prepare the data\r\n    self.prepare_data(start_date, end_date)\r\n\r\n    # compute the indicators\r\n    self.compute_indicators()\r\n\r\n    # compute the position\r\n    self.compute_position()\r\n\r\n    # compute the trades and returns\r\n    self.compute_trades_returns()\r\n\r\ndef plot_trades_returns(self):\r\n    # plot the trades and returns\r\n    fig, ax = plt.subplots(nrows=2, sharex=True, figsize=(12, 8))\r\n\r\n    ax[0].plot(self.data[\'Close\'], label=\'Price\')\r\n    ax[0].legend()\r\n\r\n    ax[1].plot(self.returns.cumsum(), label=\'Returns\')\r\n    ax[1].legend()\r\n\r\n    plt.show()', '2023-02-17 12:10:18', '2023-02-17 12:10:18');
